   197→function getFlawStrengthMappings(result: FaceIQScoreResult): { mayIndicateFlaws: string[]; mayIndicateStrengths: string[] } {
   198→  const flawMappings: Record<string, { low: string[]; high: string[] }> = {
   199→    faceWidthToHeight: {
   200→      low: ['Narrow face', 'Vertically elongated face'],
   201→      high: ['Wide face', 'Horizontally expanded face'],
   202→    },
   203→    lowerThirdProportion: {
