    },
    {
      ref_id: 'MIN-01',
      name: 'Dermal Fillers',
      description: 'Hyaluronic acid injections to add volume to chin, jawline, or cheeks. Non-permanent and reversible.',
      phase: 'Minimally Invasive',
      impact: 0.4,
      coverage: 4,
