     1→/**
     2→ * Server-Side Detection Service for Side Profiles
     3→ *
     4→ * Calls the Railway-hosted InsightFace API for accurate side profile detection.
     5→ * Returns 106 raw landmarks mapped to our 28 cephalometric landmarks.
     6→ */
     7→
     8→import { SideLandmarkResponse } from '@/app/api/side-landmarks/route';
     9→
    10→export interface ServerDetectionResult {
    11→  landmarks: Array<{ id: string; x: number; y: number }>;
    12→  confidence: number;
    13→  faceBox: { x: number; y: number; width: number; height: number };
    14→  direction?: 'left' | 'right';
    15→  rotationAngle?: number;
    16→  frankfortPlane?: {
    17→    angle: number;
    18→    orbitale: { x: number; y: number };
    19→    porion: { x: number; y: number };
    20→  };
    21→}
    22→
    23→/**
    24→ * Convert image URL to base64
    25→ */
    26→async function imageUrlToBase64(imageUrl: string): Promise<string> {
    27→  // If it's already a data URL, extract the base64 part
    28→  if (imageUrl.startsWith('data:')) {
    29→    return imageUrl;
    30→  }
    31→
    32→  // If it's a blob URL or regular URL, fetch and convert
    33→  const response = await fetch(imageUrl);
    34→  const blob = await response.blob();
    35→
    36→  return new Promise((resolve, reject) => {
    37→    const reader = new FileReader();
    38→    reader.onloadend = () => {
    39→      if (typeof reader.result === 'string') {
    40→        resolve(reader.result);
    41→      } else {
    42→        reject(new Error('Failed to convert to base64'));
    43→      }
    44→    };
    45→    reader.onerror = reject;
    46→    reader.readAsDataURL(blob);
    47→  });
    48→}
    49→
    50→/**
    51→ * Calculate Frankfort Horizontal Plane from orbitale and porion landmarks
    52→ */
    53→function calculateFrankfortPlane(
    54→  orbitale: { x: number; y: number },
    55→  porion: { x: number; y: number }
    56→): { angle: number; orbitale: { x: number; y: number }; porion: { x: number; y: number } } {
    57→  // Calculate angle from horizontal (in degrees)
    58→  const dx = porion.x - orbitale.x;
    59→  const dy = porion.y - orbitale.y;
    60→  const angle = Math.atan2(dy, dx) * (180 / Math.PI);
    61→
    62→  return {
    63→    angle,
    64→    orbitale,
    65→    porion,
    66→  };
    67→}
    68→
    69→/**
    70→ * Detect side profile landmarks using server-side InsightFace API
    71→ */
    72→export async function detectSideProfileServer(
    73→  imageUrl: string
    74→): Promise<ServerDetectionResult | null> {
    75→  try {
    76→    console.log('[ServerDetection] Starting server-side detection...');
    77→
    78→    // Convert image to base64
    79→    const base64Image = await imageUrlToBase64(imageUrl);
    80→
    81→    // Call our API proxy
    82→    const response = await fetch('/api/side-landmarks', {
    83→      method: 'POST',
    84→      headers: {
    85→        'Content-Type': 'application/json',
    86→      },
    87→      body: JSON.stringify({ image: base64Image }),
    88→    });
    89→
    90→    if (!response.ok) {
    91→      console.error('[ServerDetection] API error:', response.status);
    92→      return null;
    93→    }
    94→
    95→    const data: SideLandmarkResponse = await response.json();
    96→
    97→    if (!data.success || !data.mapped_landmarks) {
    98→      console.log('[ServerDetection] Detection failed:', data.message);
    99→      return null;
   100→    }
   101→
   102→    console.log('[ServerDetection] Detection successful:', data.message);
   103→
   104→    // Convert mapped_landmarks object to array format matching our system
   105→    const landmarks = Object.entries(data.mapped_landmarks).map(([id, point]) => ({
   106→      id,
   107→      x: point.x,
   108→      y: point.y,
   109→    }));
   110→
   111→    // Use Frankfort Plane from server if available, otherwise calculate locally
   112→    let frankfortPlane: ServerDetectionResult['frankfortPlane'];
   113→    // eslint-disable-next-line @typescript-eslint/no-explicit-any
   114→    const serverFrankfort = (data as any).frankfort_plane;
   115→    if (serverFrankfort) {
   116→      frankfortPlane = serverFrankfort;
   117→      console.log('[ServerDetection] Frankfort Plane angle (from server):', serverFrankfort.angle.toFixed(2), 'degrees');
   118→    } else if (data.mapped_landmarks.orbitale && data.mapped_landmarks.porion) {
   119→      frankfortPlane = calculateFrankfortPlane(
   120→        data.mapped_landmarks.orbitale,
   121→        data.mapped_landmarks.porion
   122→      );
   123→      console.log('[ServerDetection] Frankfort Plane angle (calculated):', frankfortPlane.angle.toFixed(2), 'degrees');
   124→    }
   125→
   126→    return {
   127→      landmarks,
   128→      confidence: 0.95, // InsightFace is generally high confidence
   129→      faceBox: data.face_box || { x: 0, y: 0, width: 1, height: 1 },
   130→      direction: data.direction,
   131→      rotationAngle: data.rotation_angle,
   132→      frankfortPlane,
   133→    };
   134→  } catch (error) {
   135→    console.error('[ServerDetection] Error:', error);
   136→    return null;
   137→  }
