          <button
            onClick={handleBackFromResults}
            className="flex items-center gap-2 text-neutral-400 hover:text-white transition-colors text-sm mb-6"
          >
            <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
