        <h4 className="font-medium text-white truncate text-sm">{ratio.name}</h4>
        <p className="text-xs text-neutral-500">
          {formatValue(ratio.value, ratio.unit)}
        </p>
      </div>
      <ChevronDown size={16} className="text-neutral-500 flex-shrink-0" />
    </button>
  );
}

