'use client';

import { motion } from 'framer-motion';
import { TrendingUp, TrendingDown, User, ScanFace, Sparkles, ChevronRight } from 'lucide-react';
import { useResults } from '@/contexts/ResultsContext';
import { TabContent } from '../ResultsLayout';
import { ScoreCircle, ScoreBar, QualityBadge } from '../shared';
import { StrengthCard, FlawCard, CompactStrengthBadge, CompactFlawBadge } from '../cards/StrengthFlawCards';
import { getScoreColor } from '@/types/results';
import { useState } from 'react';

// ============================================
// SCORE SUMMARY CARDS
// ============================================

interface ProfileScoreCardProps {
  title: string;
  score: number;
  icon: React.ReactNode;
  photo?: string;
  ratioCount: number;
  onClick?: () => void;
}

function ProfileScoreCard({ title, score, icon, photo, ratioCount, onClick }: ProfileScoreCardProps) {
  const color = getScoreColor(score);

  return (
    <motion.button
      onClick={onClick}
      className="bg-neutral-900/80 border border-neutral-800 rounded-xl p-4 hover:border-neutral-700 transition-all text-left w-full"
      whileHover={{ scale: 1.02 }}
      whileTap={{ scale: 0.98 }}
    >
      <div className="flex items-center gap-4">
        {/* Photo or icon */}
        <div className="relative w-16 h-16 rounded-lg overflow-hidden bg-neutral-800 flex-shrink-0">
          {photo ? (
            <img src={photo} alt={title} className="w-full h-full object-cover" />
          ) : (
            <div className="w-full h-full flex items-center justify-center">
              {icon}
            </div>
          )}
        </div>

        {/* Info */}
        <div className="flex-1">
          <h3 className="text-sm font-medium text-neutral-400 mb-1">{title}</h3>
          <div className="flex items-baseline gap-2">
            <span className="text-2xl font-bold" style={{ color }}>
              {score.toFixed(2)}
            </span>
            <span className="text-sm text-neutral-500">/ 10</span>
          </div>
          <p className="text-xs text-neutral-500 mt-1">{ratioCount} measurements</p>
        </div>

        {/* Arrow */}
        <ChevronRight size={20} className="text-neutral-600" />
      </div>

      {/* Score bar */}
      <div className="mt-3">
        <ScoreBar score={score} height={6} />
      </div>
    </motion.button>
  );
}

// ============================================
// HARMONY SCORE DISPLAY
// ============================================

function HarmonyScoreDisplay() {
  const { overallScore, frontScore, sideScore } = useResults();
  const color = getScoreColor(overallScore);

  return (
    <motion.div
      className="bg-gradient-to-br from-neutral-900 to-neutral-950 border border-neutral-800 rounded-2xl p-6 md:p-8 text-center"
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
    >
      <h2 className="text-lg font-medium text-neutral-400 mb-4">Overall Harmony Score</h2>

      <div className="flex justify-center mb-6">
        <ScoreCircle score={overallScore} size="xl" />
      </div>

      <div className="flex justify-center gap-8 mb-4">
        <div className="text-center">
          <p className="text-xs text-neutral-500 mb-1">Front Profile</p>
          <p className="text-xl font-bold" style={{ color: getScoreColor(frontScore) }}>
            {frontScore.toFixed(2)}
          </p>
        </div>
        <div className="w-px bg-neutral-800" />
        <div className="text-center">
          <p className="text-xs text-neutral-500 mb-1">Side Profile</p>
          <p className="text-xl font-bold" style={{ color: getScoreColor(sideScore) }}>
            {sideScore.toFixed(2)}
          </p>
        </div>
      </div>

      <p className="text-sm text-neutral-400">
        {overallScore >= 8 ? 'Exceptional facial harmony. Your features are well-balanced and proportioned.' :
          overallScore >= 6 ? 'Good facial harmony with some areas that could be optimized.' :
            overallScore >= 4 ? 'Average facial harmony. Several areas have room for improvement.' :
              'Below average facial harmony. Multiple areas could benefit from attention.'}
      </p>
    </motion.div>
  );
}

// ============================================
// OVERVIEW TAB
// ============================================

export function OverviewTab() {
  const {
    frontScore,
    sideScore,
    frontRatios,
    sideRatios,
    strengths,
    flaws,
    frontPhoto,
    sidePhoto,
    setActiveTab,
  } = useResults();

  const [expandedStrength, setExpandedStrength] = useState<string | null>(null);
  const [expandedFlaw, setExpandedFlaw] = useState<string | null>(null);

  // Show top 5 strengths and flaws
  const topStrengths = strengths.slice(0, 5);
  const topFlaws = flaws.slice(0, 5);

  return (
    <TabContent
      title="Overview"
      subtitle="Your complete facial harmony analysis"
    >
      {/* Harmony Score */}
      <div className="mb-8">
        <HarmonyScoreDisplay />
      </div>

      {/* Profile Scores */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-8">
        <ProfileScoreCard
          title="Front Profile"
          score={frontScore}
          icon={<User size={24} className="text-neutral-600" />}
          photo={frontPhoto}
          ratioCount={frontRatios.length}
          onClick={() => setActiveTab('front-ratios')}
        />
        <ProfileScoreCard
          title="Side Profile"
          score={sideScore}
          icon={<ScanFace size={24} className="text-neutral-600" />}
          photo={sidePhoto || undefined}
          ratioCount={sideRatios.length}
          onClick={() => setActiveTab('side-ratios')}
        />
      </div>

      {/* Strengths & Flaws Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        {/* Strengths */}
        <div>
          <div className="flex items-center justify-between mb-4">
            <div className="flex items-center gap-2">
              <TrendingUp size={20} className="text-green-400" />
              <h3 className="text-lg font-semibold text-white">Strengths</h3>
              <span className="text-sm text-neutral-500">({strengths.length})</span>
            </div>
          </div>

          <div className="space-y-3">
            {topStrengths.length > 0 ? (
              topStrengths.map((strength) => (
                <StrengthCard
                  key={strength.id}
                  strength={strength}
                  isExpanded={expandedStrength === strength.id}
                  onToggle={() => setExpandedStrength(
                    expandedStrength === strength.id ? null : strength.id
                  )}
                />
              ))
            ) : (
              <div className="bg-neutral-900/50 border border-neutral-800 rounded-lg p-6 text-center">
                <p className="text-neutral-500">No significant strengths detected</p>
              </div>
            )}
          </div>

          {strengths.length > 5 && (
            <button className="w-full mt-3 py-2 text-sm text-cyan-400 hover:text-cyan-300 transition-colors">
              View all {strengths.length} strengths
            </button>
          )}
        </div>

        {/* Flaws */}
        <div>
          <div className="flex items-center justify-between mb-4">
            <div className="flex items-center gap-2">
              <TrendingDown size={20} className="text-red-400" />
              <h3 className="text-lg font-semibold text-white">Areas for Improvement</h3>
              <span className="text-sm text-neutral-500">({flaws.length})</span>
            </div>
          </div>

          <div className="space-y-3">
            {topFlaws.length > 0 ? (
              topFlaws.map((flaw, index) => (
                <FlawCard
                  key={flaw.id}
                  flaw={flaw}
                  rank={index + 1}
                  isExpanded={expandedFlaw === flaw.id}
                  onToggle={() => setExpandedFlaw(
                    expandedFlaw === flaw.id ? null : flaw.id
                  )}
                />
              ))
            ) : (
              <div className="bg-neutral-900/50 border border-neutral-800 rounded-lg p-6 text-center">
                <p className="text-neutral-500">No significant flaws detected</p>
              </div>
            )}
          </div>

          {flaws.length > 5 && (
            <button className="w-full mt-3 py-2 text-sm text-cyan-400 hover:text-cyan-300 transition-colors">
              View all {flaws.length} areas
            </button>
          )}
        </div>
      </div>

      {/* Call to Action */}
      <motion.div
        className="mt-8 bg-gradient-to-r from-cyan-500/20 to-blue-600/20 border border-cyan-500/30 rounded-xl p-6 flex items-center justify-between"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 0.5 }}
      >
        <div className="flex items-center gap-4">
          <div className="w-12 h-12 rounded-xl bg-cyan-500/20 flex items-center justify-center">
            <Sparkles size={24} className="text-cyan-400" />
          </div>
          <div>
            <h3 className="font-semibold text-white">Unlock Your Potential</h3>
            <p className="text-sm text-neutral-400">
              See personalized recommendations to improve your harmony score
            </p>
          </div>
        </div>
        <button
          onClick={() => setActiveTab('plan')}
          className="px-4 py-2 bg-cyan-500 text-black font-medium rounded-lg hover:bg-cyan-400 transition-colors flex items-center gap-2"
        >
          View Plan
          <ChevronRight size={16} />
        </button>
      </motion.div>
    </TabContent>
  );
}

